import React from "react";
import {
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBInput
} from "mdbreact";

function Login() {
  return (
    <div>
      <form>
        <h1>Login </h1>
        <MDBCardBody className="mx-4 mt-4">
          <MDBInput label="User Name" group type="text" validate />
          <MDBInput label="Password" group type="password" validate />
          <p>Forgot Password? </p>
          <MDBBtn className="btn" type="button" className="btn-block z-depth-2">
            Submit
          </MDBBtn>
        </MDBCardBody>
      </form>
    </div>
  );
}
export default Login;
